import { BrowserRouter as Router, Switch, Route, Redirect } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/books" component={Books} />
        <Route path="/books/:genre" component={GenreBooks} />
        <Redirect to="/books" />
      </Switch>
    </Router>
  );
}
